import Psk from "../../../src";
const { createElement } = Psk;

import TodoItem from "./TodoItem.js";

class TodoList extends Psk.Component {
    constructor(props, stateManager) {
        super(props, stateManager);
    }

    componentDidMount() {
        this.todoList = this.querySelector('.todo-list');
    }

    componentDidUpdate() {
        this.todoList = this.querySelector('.todo-list');
    }

    componentWillUnmount() {
        this.todoList = null;
    }

    update() {
        this.props.update();
    }


    render() {
        const { todos, ...props } = this.props;

        // Create TodoItem instances and render them
        const todoItems = todos.map((todo, index) => {
            // Instantiate TodoItem with props
            const todoItem = new TodoItem({ ...props, todo, index }, this.stateManager);
            // Call the render method of TodoItem to get the DOM element
            return todoItem.render();
        });

        // Return the ul element with todoItems as children
        return createElement('ul', { class: 'todo-list' ,id:'todolist' }, todoItems);
    }
}

export default TodoList;
